import './App.css';
import Button from "./Button";
import Posts from "./Posts";

function App() {
    const handleClickHome = () => {
        console.clear();
        console.log("Home button clicked");
        return null;
    };

    const handleClickSettings = () => {
        console.clear();
        console.log("Settings button clicked");
        return null;
    };

    const handleClickContact = () => {
        console.clear();
        console.log("Contact button clicked");
        return null;
    };
  return (
    <div className="App">
      <header className="App-header">
        <div className="navbar-div">
            <Button className="navbar-button" onClick={handleClickHome} children="Home"/>
            <Button className="navbar-button" onClick={handleClickSettings} children="Settings"/>
            <Button className="navbar-button" onClick={handleClickContact} children="Contact"/>
        </div>
          <div>
              <Posts author="Matei" authorimage="https://www.wikihow.com/images/9/90/What_type_of_person_are_you_quiz_pic.png" image="https://cdn.sanity.io/images/tlr8oxjg/production/f2fb25c9cafe100e220f0caf70f92cf19a6ec3dc-1456x816.png?w=3840&q=100&fit=clip&auto=format"  preview_text="Lorem ipsum"/>

          </div>
      </header>
    </div>
  );
}

export default App;
